import React from "react";
// import Footer from "./components/footer/Footer";
// import Header from "./components/header/Header";
// import Nav from "./components/nav/Nav";
import styles from "./global/sass/main.scss";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import MainPage from "./routes/projects/components/mainPage";
import ContactPage from "./routes/contact/components/contactPage";
import AboutPage from "./routes/about/components/aboutPage";

export default function App() {
  return (
    <Router>
    <div className={styles.body}>
      <div id="nav">
      <nav>
        <ul>
        <li className = "nav-item">
            <Link to="/projects">Work</Link>
          </li>
          <li className = "nav-item">
            <Link to="/about">About</Link>
          </li>
          <li className = "nav-item">
            <Link to="/contact">Contact</Link>
          </li>
          <li className = "nav-item">
            <Link
              to={{
                pathname:
                  "https://drive.google.com/file/d/1yswrnbyyW2jdyKnh3BWLWITevmLxe3Qh/view?usp=sharing",
              }}
              target="_blank"
            >
              {" "}
              Resume{" "}
            </Link>
          </li>
        </ul>

        {/* <div id = "hamburger">
          <span id = "bar"></span>
          <span id = "bar"></span>
          <span id = "bar"></span>
        </div> */}
      </nav>

      <Switch>
        <Route path="/">
          <MainPage />
        </Route>
        <Route path="/about">
          <AboutPage />
        </Route>
        <Route path="/contact">
          <ContactPage />
        </Route>
      </Switch>
    </div>
    </div>
    </Router>
  )
}
